import Layout from '../components/MyLayout.js'
import Link from 'next/link';


const PostLink = props => {console.log(props);(
  <li>
    <Link href={`/post?title=${props.title}&shot=${props.shot}`}>
      <a>{props.title}</a>
    </Link>
  </li>
)}
export default function Blog() {
  return (
    <Layout>
      <h1>My Blog</h1>
      <ul>
        <PostLink title="Hello Next.js" />
        <PostLink title="Learn Next.js is awesome" shot="dick siuck you"/>
        <PostLink title="Deploy apps with Zeit" />
      </ul>
    </Layout>
  )
}
